import frappe.ui.form.DynamicPage.DynamicPage

@frappe.whitelist()
def make(doc, args=None):
	from frappe.utils.dateutils import get_today, getdate
	if (doc.doctype=="Purchase Invoice"):
		data = {
			"posting_date": getdate(doc.posting_date), "purchase_order": doc.purchase_order,
			"delivery_date": getdate(doc.delivery_date), "payment_date": getdate(doc.payment_date), "sales_order": doc.sales_order,
			"items": [d.item_code for d in doc.get("items")]
		}
		if (doc.doctype=="Sales Invoice"):
			data.update({
				"posting_date": getdate(doc.posting_date), "delivery_date": getdate(doc.delivery_date), "customer": doc.customer,
				"price_list": get_invoice_wise_price_list(doc.name)
			})
		else:
			data.update({
				"posting_date": getdate(doc.posting_date), "payment_date": getdate(doc.payment_date), "customer": doc.customer
			})
		return frappe.page(parenttitle=u'Dynamic Invoice', columns=1, data=data, as_json=False)</s>

